import React from 'react';
import {Link } from 'react-router-dom';
const Header = () =>{
    return (
    <div className="ui secondary pointing menu">
        <Link to="/" className="item">
            Planner
        </Link>
        <div className="right menu" >
            <Link to="/" className="item">
                A
            </Link>
        </div>
    </div>);
}
export default Header;
